import "./PlatformEnn.scss";
import React from "react";
const autoBindReact = require("auto-bind/react");

export class PlatformEnn extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
    autoBindReact(this);
  }

  renderUserEnnegram() {
    let ennegramCircles = [];

      for (let i = 1; i < 10; i++) {
        if (props.ennea !== i) {
          ennegramCircles.push(
            <div
              className={`ennegram-circle-indicator circle-indicator-item-${i}
          `}
              key={i}
              onClick={(e) => this.setEnn(i)}
            >
              <div
                className={`${
                  this.props.selectedEnnea === i ? "selectedEnn" : ""
                } enn-${i} ennType`}
              >
                {i}
              </div>
            </div>
          );
        } else {
          ennegramCircles.push(
            <div
              className={`ennegram-circle-indicator circle-indicator-item-${i} selectedEnn
          `}
              key={i}
            >
              {i}
            </div>
          );
        }
      }


    return (
      <div className="ennegram">
        <div className="circle">
          <div className="triangle"></div>
          <div className="auxiliary-triangles"></div>
          {ennegramCircles}
        </div>
      </div>
    );
  }

  render() {
    return <>{this.renderUserEnnegram()}</>;
  }
}
